/* ============================================================
 * Plugin
 * ============================================================ */
function scrollToTarget() {
	$('a.js-smooth-scroll[href^="#"]').on('click', function() {
		var speed    = 500;
		var href     = $(this).attr('href');
		var target   = $(href == '#' || href == '' ? 'html' : href);
		var headerHeight = 45;
		var positionTop  = target.offset().top - headerHeight;
		var positionLeft = $(window).scrollLeft();

		$('html, body').animate({
			scrollTop: positionTop,
			scrollLeft: positionLeft
		}, speed, 'swing');

		return false;
	});
}


function animateGlobalMenu() {
	var $win       = $(window);
	var $header    = $('#fixed_header');
	var fixedClass = 'is-fixed';

	$win.on('load scroll', function() {
		var num = $(this).scrollTop();
		$header.css('left', -$(window).scrollLeft());
		$header.next('.nav_wrap').css('left', -$(window).scrollLeft());
		$header.next('.nav_wrap').css('width', '100%').css('width', '+='+$(window).scrollLeft()+'px');

		if (num > 90) {
			$header.addClass(fixedClass);
		} else {
			$header.removeClass(fixedClass);
		}

		if ($header.hasClass('is-fixed')) {
			$header.next('.nav_wrap').css('top', '45px');
		} else {
			$header.next('.nav_wrap').css('top', 90-$(window).scrollTop());
		}
	});
}


function getWebNews() {
	$.ajax({


		/*★★★★★★表示させる為にjsonの取得元をテスト環境上のファイルに変更した！！！*/
		/*url: 'https://www.sws.co.jp/mt/mt-data-api.cgi/v2/sites/3/entries?status=Publish&sortBy=modified_on',*/
		url: '/entries.json',/*　HTMLマークアップ中はサイト内にjsonを設置とする　*/



		type: 'GET',
		dataType: 'json',
		cache : false,

		success: function(result, textStatus, xhr) {
			generateWebNewsHtml(result);
		},
		error: function(xhr, textStatus, error) {
			$('#web_news').append('<li class="lst-link__web-news-none">読み込みに失敗しました。</li>')
		}
	})
}

function generateWebNewsHtml(result) {
	var count   = 0;
	var strHtml = '';

	$.each(result.items, function(key, value) {
		if (value.title !== '人事異動' && key !== 'totalResults') {
			var strPartDate  = adjustWebNewsDate(value.date).join('.');
			var strPartTitle = value.title;
			var strPartLinkHref = value.permalink;
			var strPartLinkType = false; // true:not blank , false:blank
			var newsDate = new Date(value.date);
			var nowDate  = new Date();
			var diffDate = (nowDate - newsDate)/1000/60/60/24;

			strHtml += '<li>';
			strHtml += '<a href="'+strPartLinkHref;
			strPartLinkType === true ? strHtml += '">' : strHtml += '" target="_blank">';
			strHtml += '<p class="lst-link__info">';
			strHtml += '<span class="lst-link__date">'+strPartDate+'</span>';
			if (diffDate < 14) {
				strHtml += '<span class="lst-link__lbl lbl-new">NEW</span>';
			}
			strHtml += '</p>';
			strHtml += '<p class="lst-link__text">'+strPartTitle+'</p>';
			strHtml += '</a>';
			strHtml += '</li>';

			count++;
		}
	});

	if (count == 0) {
		strHtml = '<li class="lst-link__web-news-none">現在掲載しているニュースはありません。</li>'
		$('#web_news').append(strHtml);
	} else {
		$('#web_news').append(strHtml);
	}
}

function adjustWebNewsDate(data) {
	var resultArr = [];

	for(var i=0; i<3; i++) {
		i == 0 ? resultArr.push(data.substring(0,4)) : false;
		i == 1 ? resultArr.push(parseInt(data.substring(7,5))) : false;
		i == 2 ? resultArr.push(parseInt(data.substring(10,8))) : false;
	}

	return resultArr;
}

function bannerSlider() {
	if ($('.js-bnr').get(0)) {
		$('.js-bnr').slick({
			dots: true,
			speed: 300,
			slidesToShow: 3,
			slidesToScroll: 3
		});
	}
}

function globalMenu(){
	var tabletModeFlg = checkDevice('android')||checkDevice('apple');
	function changeDisplay(_flg,$parent,$child,effect){
		if(_flg){
			if($parent.hasClass('active')) return;
			if(effect){
				$child.stop().slideDown(300,'easeOutCubic');
			}else{
				$child.stop().show();
			}
			$parent.addClass('active');
		}else{
			if(!$parent.hasClass('active')) return;
			$child.stop(true,true).hide();
			$parent.removeClass('active');
		}
	}
	var savedActiveDrop = {$parent:null,$child:null};
	function closeActiveDrop(){
		closeActiveColumnB();
		if(savedActiveDrop.$parent && savedActiveDrop.$child){
			changeDisplay(false,savedActiveDrop.$parent,savedActiveDrop.$child);
			savedActiveDrop.$parent = null;
			savedActiveDrop.$child = null;
		}
	}
	var savedActiveColumnB = {$parent:null,$child:null};
	function closeActiveColumnB(){
		if(savedActiveColumnB.$parent && savedActiveColumnB.$child){
			changeDisplay(false,savedActiveColumnB.$parent,savedActiveColumnB.$child);
			savedActiveColumnB.$parent = null;
			savedActiveColumnB.$child = null;
		}
	}
	(function(){
		if(!tabletModeFlg){return;}
		var $contentHead = $('#contentHead');
		var $contentHeadDropWrapper = $('#contentHeadDropWrapper');
		$contentHead.find('#globalMenu').addClass('noHover');
		$contentHeadDropWrapper.addClass('noHover'); 
		var contentHead = $contentHead[0];
		var contentHeadDropWrapper = $contentHeadDropWrapper[0];
		var moveFlg = false;
		$(document).on('touchstart',function(){
			moveFlg = false;
		}).on('touchmove',function(){
			moveFlg = true;
		}).on('touchend',function(e){
			if(!moveFlg && !$.contains(contentHead, e.target) && !$.contains(contentHeadDropWrapper, e.target)){
				closeActiveDrop();
			}
			moveFlg = false;
		});
	})();
	$('#globalMenu li a').each(function(){
		var $btn = $(this);
		var seq = parseInt($btn.parent('li').attr('id').split('globalMenu')[1],10);
		var $drop = $('#contentHeadDropWrapper div.contentHeadDrop').eq(seq-1);
		if(!$drop.length) return true;
		var hAry = [];
		var $colC = $drop.find('.columnC');
		var $childA=$drop.find('.columnA dl');
		var $childB=$drop.find('.columnB').children();
		var $childC=$drop.find('.columnC').children();
		$('div ul li a[class*=headDropParent]',$drop).each(function(index, element) {
			var $parent = $(this);
			var childNum = $parent.attr('class').split('headDropParent')[1];
			var $child = $('div .headDropChild'+childNum,$drop);
			if(!$child.length) return true;
			if(tabletModeFlg){
				$('<li />').append($parent.clone('false').removeAttr('class')).prependTo($child);
				$parent.attr('href','javascript:void(0);')
				.removeAttr('onclick')
				.on('click',function(e){
					closeActiveColumnB();
					changeDisplay(true,$parent,$child);
					savedActiveColumnB.$parent = $parent;
					savedActiveColumnB.$child = $child;
				});
			}else{
				$parent.on('mouseenter',function(e){
					changeDisplay(true,$parent,$child);
				}).on('mouseleave',function(e){
					if(e.relatedTarget == $child[0]) return;
					changeDisplay(false,$parent,$child);
				});

				$child.on('mouseenter',function(e){
					changeDisplay(true,$parent,$child);
				}).on('mouseleave',function(e){
					if(e.relatedTarget == $parent[0]) return;
					changeDisplay(false,$parent,$child);
				});
			}
		});
		hAry.push($childA.height());
		if($childB.length){
			$childB.each(function(){
				hAry.push($(this).height());
			});
		}
		if($childC.length){
			$childC.each(function() {
				$(this).css({'visibility':'hidden',
					'display':'block'});
				hAry.push($(this).height());
				$(this).css({'visibility':'',
					'display':''});
			});
		}
		var _maxH = Math.max.apply(null,hAry);
		$childA.css({'height':_maxH+'px'});
		$childB.css({'height':_maxH+'px'});
		$childC.each(function() {
			$(this).css({'height':_maxH+'px'});
		});
		var _h = $childC.eq(0).outerHeight();
		$colC.css({'height':_h+'px'});
		$drop.css({
			'visibility':'visible',
			'display':'none',
			'height' :'430px'});
		if(tabletModeFlg){
			$btn.attr('href','javascript:void(0);').on('click',function(e){
				if(savedActiveDrop.$parent === $btn){
					closeActiveDrop();
				}else{
					closeActiveDrop();
					changeDisplay(true,$btn,$drop,true);
					savedActiveDrop.$parent = $btn;
					savedActiveDrop.$child = $drop;
				}
			});
		}else{
			$btn.on('mouseenter',function(e){
				changeDisplay(true,$btn,$drop,true);
			}).on('mouseleave',function(e){
				if(e.relatedTarget == $drop[0]) return;
				changeDisplay(false,$btn,$drop);
			});
			$drop.on('mouseenter',function(e){
				changeDisplay(true,$btn,$drop);
			}).on('mouseleave',function(e){
				if(e.relatedTarget == $btn[0]) return;
				changeDisplay(false,$btn,$drop);
			});
		}
	});
};
